import Navigation from './components/Navigation';
import Footer from './components/Footer';

export default function Projects() {
  const data = [
    { id: "one-ai", name: 'One AI', description: "TODO", url: "https://github.com/quaxlyqueen/one-ai"},
  ];

  return (
    <>
      <Navigation />
        <div>
          {data.map(item => (
            <ProjectDisplay id={item.id} name={item.name} description={item.description} url={item.url} />
          ))}
        </div>
      <Footer />
    </>
  );
}
